```solidity
pragma solidity ^0.5.0;

contract YourContract {
    address payable public owner;
    uint256[] public allscamsforsale;
    mapping(uint256 => uint256) public startingpriceof;
    mapping(uint256 => uint256) public nextpriceof;
    mapping(uint256 => address payable) public ownerof;
    mapping(uint256 => string) private tokenURI;
    uint256 private totalSupply;

    constructor() public payable {
        owner = msg.sender;
        totalSupply = 5;
        if (msg.value == 0) {
            owner = msg.sender;
        }
    }

    function setOwner(address newOwner) public {
        require(msg.sender == owner);
        owner = newOwner;
    }

    function withdraw() public {
        require(msg.sender == owner);
        owner.transfer(address(this).balance);
    }

    function setCut(uint256 cut) public {
        require(msg.sender == owner);
        require(cut <= 10 && cut >= 0);
        totalSupply = cut;
    }

    function listScam(uint256 _tokenId, string memory _tokenURI, uint256 _price) public {
        require(ownerof[_tokenId] == address(0));
        require(msg.sender == owner);
        require(_price > 0);
        ownerof[_tokenId] = msg.sender;
        nextpriceof[_tokenId] = _price;
        startingpriceof[_tokenId] = _price;
        tokenURI[_tokenId] = _tokenURI;
        allscamsforsale.push(_tokenId);
    }

    function buy(uint256 _tokenId) public payable {
        require(ownerof[_tokenId] != address(0));
        require(msg.value == nextpriceof[_tokenId]);
        require(nextpriceof[_tokenId] > 0);
        require(msg.sender != ownerof[_tokenId]);

        address payable previousOwner = ownerof[_tokenId];
        ownerof[_tokenId] = msg.sender;

        if (nextpriceof[_tokenId] == 0) {
            nextpriceof[_tokenId] = 0;
            previousOwner.transfer(nextpriceof[_tokenId]);
        } else {
            uint256 saleShare = (totalSupply * nextpriceof[_tokenId]) / 100;
            previousOwner.transfer(msg.value - saleShare);
            nextpriceof[_tokenId] = (125 * nextpriceof[_tokenId]) / 100;
        }
    }
}
```
This contract has a constructor that sets the `owner` to the message sender and the `totalSupply` to 5. The `setOwner` function allows the owner to change the owner address. The `withdraw` function allows the owner to withdraw all the funds from the contract. The `setCut` function allows the owner to set the cut as long as it's between 0 and 10. The `listScam` function allows the owner to list a new scam for sale. The `buy` function allows a user to buy a scam.
